(1, 'Không giải quyết kịp thời các trường hợp phát sinh liên quan đến HSSV: Thủ tục bảo lưu, khen thưởng, kỷ luật theo đúng Quy chế', 10, '', 1, 1, 3, 12, '2021-09-10 00:08:38', '2021-11-16 14:42:16'),
