INSERT INTO `ps_member_departments` (`id`, `ps_member_id`, `ps_department_id`, `start_at`, `stop_at`, `ps_certificate_id`, `ps_degree_id`, `ps_reduce_id`, `position_code`, `is_activated`, `is_current`, `note`, `user_created_id`, `user_updated_id`, `created_at`, `updated_at`) VALUES
(2, 16, 1, '2018-01-01 00:00:00', NULL, 1, 1, NULL, 'HT', 1, 0, '<div class="padding-top">\r\n<h2><a name="tab1"></a>Giới thiệu / kỹ năng</h2>\r\n- Nghiên cứu các tính chất khuếch tán của bán dẫn, kim loại, hợp kim.</div>\r\n<div class="padding-top">\r\n<h2><a name="tab2"></a>Văn bằng chứng chỉ</h2>\r\n1. Bằng Cử nhân Vật lý.<br />2. Bằng Thạc sỹ Vật lý.<br />3. Bằng Tiến sỹ Vật lý.</div>\r\n<div class="padding-top">\r\n<h2><a name="tab3"></a>Quá trình công tác</h2>\r\nTừ 1995 đến nay là giảng viên Khoa Vật lý, Trường ĐHSP Hà Nội 2.<br /> </div>\r\n<div class="padding-top">\r\n<h2><a name="tab5"></a>Quá trình đào tạo</h2>\r\n<ol>\r\n<li><strong>Đại học</strong></li>\r\n</ol>\r\nHệ đào tạo: Chính quy                               <br />hời gian đào tạo từ  9/1991 đến 6/1995<br />Nơi học: Trường đại học Sư phạm Hà nội 2<br />Ngành học: Vật lí-Kỹ thuật CN\r\n<ol>\r\n<li value="2"><strong>Thạc sĩ</strong></li>\r\n</ol>\r\nThời gian đào tạo: từ 11/2001 đến 11/2003<br />Nơi học: Trường đại học Sư phạm Hà nội.<br />Ngành học: Vật lý lý thuyết\r\n<ol>\r\n<li value="3"><strong>Tiến sĩ</strong></li>\r\n</ol>\r\nHình thức đào tạo: Không tập trung         <br />Thời gian đào tạo từ 12/2008  đến  12/2012<br />Nơi đào tạo: Trường Đại học Sư phạm Hà Nội.<br /> </div>\r\n<div class="padding-top">\r\n<h2><a name="tab6"></a>Dự án / Đề tài</h2>\r\n1. Vũ Văn Hùng, Nguyễn Thị Hòa, Phạm Thị Minh Hạnh, Lê Thị Mai Thanh, <strong>Phan Thị Thanh Hồng</strong>, Đặng Thanh Hải, “ Nghiên cứu ảnh hưởng của nhiệt độ, áp suất cao lên các tính chất cơ nhiệt và cumulants phổ hấp thụ tia X của màng mỏng, siêu mạng kim loại và bán dẫn, vật dẫn ion và kim loại, hợp kim đất hiếm”, Đề tài Cấp Quốc gia, Thành viên thực hiện đề tài.<br /><br />Mã số nhiệm vụ: 103.01-2011.16; <br />Giấy Chứng nhận Đăng kí kết quả kí ngày 21 tháng 12 năm 2015.<br /><br />2. Phạm Thị Minh Hạnh, <strong>Phan Thị Thanh Hồng</strong>, “Nghiên cứu ảnh hưởng của khuyết tật lên các tính chất nhiệt động và đàn hồi của Si”. Đề tài Cấp Cơ sở, Thành viên thực hiện đề tài.<br />Mã số: C.2015.06;<br />Xếp loại: Tốt.<br /><br />3. Hồ Khắc Hiếu, Trần Thị Hải, <strong>Phan Thị Thanh Hồng</strong>, Nguyễn Ngọc Hà, Nguyễn Mạnh Hải, “Nghiên cứu tính chất nhiệt động của sắt với các pha cấu trúc khác nhau dưới áp suất cao”. Đề tài Cấp Quốc gia, Thành viên chủ chốt thực hiện đề tài.<br />Mã số nhiệm vụ: 103.01-2014.12; Chưa nghiệm thu.<br /><br />4. <strong>Phan Thị Thanh Hồng</strong>, Phạm Thị Minh Hạnh, “Nghiên cứu sự tự khuếch tán trong tinh thể Si và Ge dưới ảnh hưởng của nhiệt độ”. Đề tài Cấp Cơ sở, Chủ nhiệm đề tài.<br />Mã số: C.2017.02;<br />Xếp loại: Tốt.<br /><br /><br /> </div>\r\n<div class="padding-top">\r\n<h2><a name="tab7"></a>Sách / Bài báo xuất bản</h2>\r\n1. Vũ Văn Hùng, Nguyễn Quang Học và <strong>Phan Thị Thanh Hồng</strong> (2004),  “Nghiên cứu sự tự khuếch tán trong các bán dẫn bằng phương pháp thống kê mô men”, <em>Những vấn đề hiện đại của vật lý chất rắn</em>, Nhà xuất bản Khoa học và Kỹ thuật, <strong>tập III-A</strong>, tr. 121-125.<br />2. Vu Van Hung, Jaichan Lee, K. Masuda-Jindo and <strong>P. T. T. Hong</strong> (2006), “Study of Self-Diffusion in Silicon at High Pressure”, <em>Journal of Physical Society of Japan</em>, <strong>75</strong>(2), pp. 024601-1-024601-7.<br />3. Vu Van Hung, <strong>Phan Thi Thanh Hong</strong>, and Nguyen Thanh Hai (2010), “Study of Self-Diffusion in GaAs Crystal: Temperature Dependence”, <em>Communications in Physics</em>, <strong>20</strong>(3), pp. 227-231.<br />4. Vu Van Hung, <strong>Phan Thi Thanh Hong</strong>, Bui Van Khue (2010), “Boron and  Phosphorus Diffusion in Silicon: Interstitial, vacancy and combination mechanisms”, <em>Proc. Natl. Conf. Theor. Phys.</em>, <strong>35 </strong>(2010), pp. 73-77.<br />5. Vu Van Hung and <strong>Phan Thi Thanh Hong</strong> (2011), “Boron and Phosphorus Diffusion in Silicon: Pressure Dependence”, <em>Proc. Natl. Conf. Theor. Phys.</em>, 36 (2011), pp. 154-158.<br />6. Vu Van Hung and <strong>Phan Thi Thanh Hong</strong> (2012), “Effect of Strain on Impurity Diffusion in Silicon”, <em>J. Sci. HNUE.</em>, Vol. <strong>57</strong>, No. 7, pp. 71- 78.<br />7. Vu Van Hung, <strong>Phan Thi Thanh Hong</strong> (2012), "Activation Volume for Diffusion in Silicon", <em>Proc. Natl. Conf. Theor. Phys.</em>, <strong>37 </strong>(2012), pp. 174-179.<br />8. <strong>Phan Thị Thanh Hồng</strong>,  Phùng Thị Lan, Hồ Khắc Hiếu (2016), “Hệ số Debye-Waller của kim loại dưới áp suất cao”, Tạp chí Khoa học và Công nghệ, Trường Đại học Duy Tân, <strong>1(</strong>18<strong>)</strong>, tr. 38-43.<br />9. Phạm Thị minh Hạnh, <strong>Phan Thị Thanh Hồng</strong> (2016), “Nghiên cứu ảnh hưởng của khuyết tật lên tính chất đàn hồi của Si”, Tạp chí Khoa học, Trường Đại học Sư phạm Hà Nội 2, số <strong>43</strong>, tr. 23-32.<br />10. <strong>Phan Thị Thanh Hồng</strong>, Phạm Thị minh Hạnh, Đào Thị Quỳnh (2017), "Ảnh hưởng của nhiệt độ lên sự tự khuếch tán trong tinh thể Ge", Tạp chí Khoa học, Trường Đại học Sư phạm Hà Nội 2, số <strong>47</strong>, tr. 3-12.<br />11. Nguyen Viet Tuyen, Tran Thi Hai, Nguyen Thi Hong, <strong>Phan Thi Thanh Hong</strong>, Ho Khac Hieu (2017), “High-pressure EXAFS Debye-Waller Factors of Metals”, VNU Journal of Science: Mathematics – Physics, Vol. 33, No. 1 (2017) 78-82.<br />12. <strong>Phan Thị Thanh Hồng</strong>, Trần Thị Hải, Hồ Khắc Hiếu (2017), “Nghiên cứu hệ số Debye-Waller phổ EXAFS của đồng dưới áp suất”, Tạp chí Khoa học và Công nghệ, Trường Đại học Duy Tân, <strong>2</strong>(21), tr. 70-75.<br /> </div>\r\n<div class="padding-top">\r\n<h2><a name="tab8"></a>Báo cáo tại các hội thảo</h2>\r\n1. Hội nghị Vật lý chất rắn toàn quốc lần thứ IV, năm 2003.<br />2. Hội nghị Vật lý lý thuyết toàn quốc lần thứ 29, năm 2004.<br />3. Hội nghị Vật lý lý thuyết toàn quốc lần thứ 34, năm 2009.<br />4. Hội nghị Vật lý lý thuyết toàn quốc lần thứ 35, năm 2010.<br />5. Hội nghị Vật lý toàn quốc lần thứ VII, năm 2010.<br />6. Hội nghị Vật lý lý thuyết toàn quốc lần thứ 36, năm 2011.<br />7. Hội nghị Vật lý lý thuyết toàn quốc lần thứ 37, năm 2012.</div>\r\n<div class="padding-top">\r\n<h2><a name="tab10"></a>Các môn giảng dạy</h2>\r\n<a name="tab10"></a>1. Quang học.<br />2. Thực hành Vật lý đại cương 1.<br />3. Thực hành vật lý đại cương 2.</div>', 3, 3, '2020-01-08 16:12:09', '2020-03-12 13:27:53'),
